INSERT INTO `website_content` (`ID`, `ContentID`, `Name`, `Content`) VALUES
(1, 'OurStory', 'Our Story', '<p>Pellentesque habitant morbi tristique senectus et netus et malesuada \r\nfames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, \r\nultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam \r\negestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend \r\nleo. Quisque sit amet est et sapien ullamcorper pharetra. Vestibulum \r\nerat wisi, condimentum sed, commodo vitae, ornare sit amet, wisi. Aenean\r\n fermentum, elit eget tincidunt condimentum, eros ipsum rutrum orci, \r\nsagittis tempus lacus enim ac dui. Donec non enim in turpis pulvinar \r\nfacilisis. Ut felis. Praesent dapibus, neque id cursus faucibus, tortor \r\nneque egestas augue, eu vulputate magna eros eu erat. Aliquam erat \r\nvolutpat. Nam dui mi, tincidunt quis, accumsan porttitor, facilisis \r\nluctus, metus</p>\r\n              <ul><li>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.</li><li>Aliquam tincidunt mauris eu risus.</li></ul>'),
(2, 'EtcCard', 'Etc. Card', 'The card gives you access to all the promotions listed on this website. It functions like a bonus point card, the more you spend, the more points you collect. The bonus points will only be awarded for purchases of pre-set thresholds.  \r\n\r\nBonus points maybe used for future bookings for space and services.\r\n\r\nFor members who do not have an etc.card, you may pay using the normal payment gateway. '),
(3, 'Help', 'Help', '<p>Pellentesque habitant morbi tristique senectus et netus et malesuada \r\nfames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, \r\nultricies eget, tempor sit amet, ante. Donec eu libero sit amet quam \r\negestas semper. Aenean ultricies mi vitae est. Mauris placerat eleifend \r\nleo. Quisque sit amet est et sapien ullamcorper pharetra. Vestibulum \r\nerat wisi, condimentum sed, commodo vitae, ornare sit amet, wisi. Aenean\r\n fermentum, elit eget tincidunt condimentum, eros ipsum rutrum orci, \r\nsagittis tempus lacus enim ac dui. Donec non enim in turpis pulvinar \r\nfacilisis. Ut felis. Praesent dapibus, neque id cursus faucibus, tortor \r\nneque egestas augue, eu vulputate magna eros eu erat. Aliquam erat \r\nvolutpat. Nam dui mi, tincidunt quis, accumsan porttitor, facilisis \r\nluctus, metus</p>\r\n              <ul><li>Lorem ipsum dolor sit amet, consectetuer adipiscing elit.</li><li>Aliquam tincidunt mauris eu risus.</li></ul>'),
(4, 'FAQ', 'FAQ', '<div class=\"col-md-6\">\r\n<h5>1. REGISTRATION RELATED</h5>\r\n<h6>Q: Can I register as a user and a service provider?</h6>\r\n<p class=\"text-muted mb-4\">A: Yes, you may register as service provider from your user panel/profile.</p>\r\n<h6>Q: I have registered as a space owner/service provider. How long do I have to wait before I can start listing?</h6>\r\n<p class=\"text-muted mb-4\">A: Cowork-etc. will take approximately 1 week to review completeness of your registration and will send confirmation within 7 days.</p>\r\n<h6>Q: There are a lot of criterias and options for space owners registration. Can we pick and choose what we want to list?</h6>\r\n <p class=\"text-muted mb-4\">A: Yes, the various options given to you for completion is for marketing of your workspace and for promotional purposes. You are free to dictate which fields you want to complete.</p>\r\n<h6>Q: What does it cost to list a space or a service?</h6>\r\n<p class=\"text-muted mb-4\">A: Currently, listing is FOC, there is no charge. An admin fee is charged upon successful booking and will be stipulated in the contract with Cowork-etc.</p>\r\n<h5>2. SEARCHING FOR AVAILABLE SPACE</h5>\r\n<h6>Q: Why does Cowork-etc. need my location?</h6>\r\n<p class=\"text-muted mb-4\">A: This is to enable detection of nearest co-workspace located in your vicinity. You are advised to check box remember for one day  this is to enable Cowork-etc. to detect your location for one day , regardless of your movements during the day.\r\n</p>\r\n<h5>3. BOOKING RELATED</h5>\r\n<h6>Q: Is my booking instant  can I assume once I made payment, I have a spot in a co-workspace or I will get the specified service?</h6>\r\n<p class=\"text-muted mb-4\">A: Booking for a space or a service depends on availability. Please wait for confirmation message. We will strive to confirm within the same day.</p>\r\n<h6>Q: I have not decided on my booking but would like to shortlists the ones I am interested in?</h6>\r\n<p class=\"text-muted mb-4\">A: You may store your selections in shopping cart. Shopping cart will be cleared after 30 days.</p>\r\n </div>'),
(5, 'About', 'About Cowork~etc', 'Cowork~etc. is an aggregator for business support services and co-working spaces.  \r\n\r\nOur primary focus is to help startups/SMEs to navigate through questions like whether you should set up a company, how to market your solutions, how to appease your investors, if you need to pay the tax man and a multitude of other challenges you\'ll be experiencing as an entrepreneur.\r\n\r\nWe have partnered with credible service providers who had helped us on our journey to support you. \r\n\r\nWe are launching our beta testing and are inviting co-working spaces and service providers to list with us. \r\n\r\nStartups and SMEs : Watch this space for updates of new services.....\r\n\r\n'),
(6, 'News', 'What\'s New', 'We are new and will be updating our website with new spaces and services from time to time - please be patient and do visit our site regularly for new updates. \r\n\r\nTo mark our launch, we are offering 100 bonus points for the first 100 user(exclude space owners and service providers) registration. The bonus points will be credited to member\'s \"ETC\" card and may be used to book a space or a service. Enjoy browsing! '),
(7, 'Announcement', 'Announcement', 'We are launching soon!'),
(8, 'TermsAndConditions', 'Terms & Conditions', 'TERMS & CONDITIONS (T&C)\r\n1.	Introduction\r\n1.1	The Cowork-etc. website is a portal for startups and small medium enterprises (SME) to subscribe to value added services (VAS) using co-workspace and event space as a marketing, collaboration and matching channel. The company COWORK ETC. Sdn. Bhd. (Cowork-etc) is a private limited company incorporated in Malaysia and function as a matching agent to bring together space owners and service providers to provide a space or a service to startups/SMEs. \r\n1.2	As a user of this website, you agree to comply by the terms and conditions detailed herein. A user of this website could take the form of:\r\na)	A work-space/event space/F&B space/living cum work space providers (referred to as Space provider)\r\nb)	User comprising of start-ups or SMEs who are interested in subscribing in a VAS or a work/living and work space (referred to as User)\r\nc)	Service providers (SP) providing one or a combination of the VAS\r\nd)	Cowork-etc. personnel (referred to as Cowork administrators/Admin)\r\n1.3	In the event of any third party logging into and use your Cowork-etc account to use this website, you shall be responsible and liable for the use of this website by such other person, including all charges incurred by such third party, up to the time when you have notified Cowork-etc in writing that such third party had not been authorised to use your account.\r\n1.4	We will make every effort to inform you of changes to this T&C. Please check the T&C section for any amendments periodically. \r\n\r\n2.	Contractual Agreement\r\n2.1	Any party to this agreement may end the arrangements by giving at least thirty (30) days written notice. Termination does not affect accrued or continuing rights or obligations (including an obligation to pay) under this agreement. \r\n2.2	Cowork-etc. is entitled to modify this agreement at any time. Any modification is effective upon the posting of same by Cowork-etc. on its website. \r\n2.3	Unless otherwise notified, the contract shall continue beyond the contractual end date. \r\n&#8195;\r\n3.	Roles & Responsibilities\r\n3.1 	General\r\nAs a user of this website, you commit to the following:\r\na)	All information supplied by you on this Website is accurate and complete. Reliance will be placed on the information provided and will not be verified. \r\nb)	You are responsible for the safeguarding and archiving of your data and prevention against security breaches. \r\nc)	 You authorize Cowork-etc. to have access to your data on this website strictly for analytics, benchmarking and service enhancement purposes. \r\nd)	This Website may contain discussion forums, review of services or other content meant as feedback to improve the processes and services of space providers and service providers. You undertake that you will exercise due care not to post sensitive information that breaches privacy, unlawful, libelous, defamatory, indecent, threatening, abusive, inflammatory, fraudulent and/r otherwise objectionable.\r\ne)	Users may not take legal action against Cowork-etc., space providers or service providers (or vice versa) for their opinions in the form of media (text, photo, reviews, comments) created and published on the Cowork Website.\r\nf)	In the event that Cowork-etc suffers any claim, loss and/or damages as a result, whether directly or indirectly of your breach of this Agreement and/or your negligent acts and/or omissions, you undertake to bear such loss and/or damages including any legal costs in relation thereto.  \r\n\r\n3.2	Disclaimer.\r\na)	Cowork-etc. takes no responsibility and assumes no liability for any Content posted, stored or uploaded by you or any third party, or for any loss or damage thereto, nor is Cowork-etc. liable for any breaches in Section 3.1 above. Cowork-etc. is not liable for any statements, representations and/or content provided by its users. Cowork-etc. reserves the right to pursue legal action against perpetrators for damages caused by these and other prohibited activities.\r\nb)	Cowork-etc. reserves the right, and has absolute discretion, to remove, screen and edit without notice any content posted or stored on this Website at any time and for any reason.  You are solely responsible for creating backup copies on this Website at your own costs.\r\nc)	Cowork-etcs listings of property spaces and services provided should not be construed as endorsements. You agree that Cowork-etc. is not responsible for the accuracy or completeness of information posted by space providers and service providers.\r\n\r\n\r\n4.	Settlement of disputes \r\nSpace and service providers are bound to honor the rates, pricing, bookings listed, terms and conditions, and to ensure quality of services provided. In the event of failure to deliver and/or any dispute between any space providers, service providers and users, Cowork-etc. is entitled to arbitrate on a best effort basis between space provider or service providers and users to reach a satisfactory resolution or mutual agreement, which may include the issuance of a refund or obligation to rectify and imposition of costs. Failure to reach mutual agreement should not be claimed against Cowork-etc.\r\n\r\n5.	Links to Third Party Sites\r\nThis Website may contain hyperlinks to websites operated by parties other than Cowork-etc. for your reference. Cowork-etc has no control over such websites and are not responsible for their contents or the privacy or other practices of such websites. Further, it is up to you to take precautions to ensure that whatever links you select or software you download (whether from this Website or other websites) is virus free.\r\n\r\n6.	Payments & Billings \r\nContract parties must provide valid bank/credit card information to effect payment and billings. \r\nSpace owners and service providers hereby authorizes Cowork-etc. to collect payment and any amount of dues on their behalf. Cowork-etc. will do settlement of accounts with space owners and service providers on weekly basis or at regular intervals to be negotiated separately and as stipulated in Appendix A.\r\n\r\n7.	Intellectual Property\r\nThe content and the intellectual properties on this Website are proprietary of Cowork-etc. You agree not to replicate any of its content without our written consent. Our service providers shall own the intellectual property rights in the deliverables and in any materials brought to or created by such service providers under this agreement.\r\n \r\n8.	Confidentiality \r\nWe will keep confidential all information we receive from you under the agreement and will not disclose it except if required by law, regulation, our operational processes and/or compulsory process to protect Cowork-etcs business interests.\r\n\r\n\r\n9.   Data Protection\r\n9.1	Cowork-Etc and/or its authorised agents may collect, obtain, store and/or process your personal data (Data) that you provide from time to time for the sole purpose of receiving updates, news, promotional updates, marketing materials and to trouble shoot issues you may have with our space owners or service providers. Data includes all data defined within the Personal Data Protection Act 2010.\r\n9.2	You hereby give your consent to Cowork-Etc to:\r\na)	store and process your personal Data to establish your identity and background such as your full name, passport or identity card number, nationality and contact information.\r\nb)	store and process payment information such as your debit or credit card information, including the name of cardholder, card number, billing address, expiry date and other bank account details for billing purposes.\r\nc)	disclose your Data to the relevant governmental authorities and/or third parties where required by law or for legal purposes.\r\nd)	Record of calls placed by you to our customer services where applicable.\r\ne)	store and process the information in your profile.\r\n9.3	Only the data indicated by you for processing may be transferred to relevant space owners and service providers for the purpose of processing a space/service booking by you.\r\n\r\n10.	Governing Law\r\n10.1	This agreement is governed by and shall be construed in accordance with the laws of Malaysia, and parties are subjected to the jurisdiction of the Courts in Malaysia. \r\n10.2	A party will not be liable if it does not meet an obligation (other than one to pay) due to a matter beyond its control. \r\n\r\n11.	Enquires\r\nFor answers to your questions please email us at enquiry@cowork-etc.com \r\n'),
